package com.leetcode.algorithm.medium.permutationsii;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

class Solution {
  public List<List<Integer>> permuteUnique(int[] nums) {
    Arrays.sort(nums);
    List<List<Integer>> result = new ArrayList<>();
    boolean[] visited = new boolean[nums.length];
    helper(result, new ArrayList<>(), nums, visited);
    return result;
  }

  private void helper(List<List<Integer>> result, List<Integer> list, int[] nums, boolean[] visited) {
    if (list.size() == nums.length) {
      result.add(new ArrayList<>(list));
      return;
    }

    for (int i = 0; i < nums.length; i++) {
      if (visited[i]) {
        continue;
      }

      if (i > 0 && nums[i] == nums[i - 1] && !visited[i - 1]) {
        continue;
      }

      visited[i] = true;
      list.add(nums[i]);
      helper(result, list, nums, visited);
      list.remove(list.size() - 1);
      visited[i] = false;
    }
  }
}
package com.leetcode.algorithm.medium.permutationsequence;

import java.util.ArrayList;
import java.util.List;

class Solution {
  public String getPermutation(int n, int k) {
    List<Integer> numbers = new ArrayList<>();
    int[] factorial = new int[n + 1];
    StringBuilder sb = new StringBuilder();

    int sum = 1;
    factorial[0] = 1;
    for (int i = 1; i <= n; i++) {
      sum *= i;
      factorial[i] = sum;
    }

    for (int i = 1; i <= n; i++) {
      numbers.add(i);
    }

    k--;

    for (int i = 1; i <= n; i++) {
      int index = k / factorial[n - i];
      sb.append(numbers.get(index));
      numbers.remove(index);
      k -= index * factorial[n - i];
    }

    return sb.toString();
  }
}
